import React from 'react';
import './A.css';

function About() {
  return (
    <div style={{ textAlign: 'center', padding: '20px' }}>
      <h1>About Us</h1>
      <p>The Department of Computer Science & Engineering (CSE) at the University of Chittagong launched its undergraduate major programme in 2001 and its postgraduate programme in 2010. CSE department currently hosts 22 faculty members, including eight Professors and around 400 students. There are 300 undergraduate students, 100 MSc students, and a few postgraduate research students in CSE department, carrying out learning and research activities in a very co-operative and friendly environment.</p>
    </div>
  );
}

export default About;
